import React, { Component } from 'react';
import DocumentTitle from 'react-document-title';

export default class Statistical extends Component {
    render() {
        return (
            <DocumentTitle title='.:Quản lý tài khoản:.'>
                <div>
                    
                </div>
            </DocumentTitle>
        )
    }
}
